import React from "react";
import logo from "./logo.svg";
import "./App.css";

import { Fragment } from "react";
import { Disclosure, Menu, Transition } from "@headlessui/react";

function App() {
    function classNames(...classes: any[]) {
        return classes.filter(Boolean).join(" ");
    }

    const navigation = [
        { name: "Test 123", href: "#" },
        { name: "Test Nav", href: "#" },
        { name: "Test Dash", href: "#" },
    ];

    return (
        <div className="">
            <div
                id="name"
                className="h-20 border-b-2 w-full font-bold text-2xl font-mono flex items-center justify-center"
            >
                <p className="font-bold text-3xl text-center text-transparent bg-clip-text bg-gradient-to-r from-blue-500 to-pink-600">
                    thoughtfulkoala666
                </p>
                <div id="nav-items" className="flex justify-between">
                    {navigation.map((item) => (
                        <a key={item.name} href={item.href}>
                            {item.name}
                        </a>
                    ))}
                </div>
            </div>
        </div>
    );
}

export default App;
